import {
    GET_USERS_REQUEST,
    GET_USERS_FAIL,
    GET_USERS_SUCCESS,
    ADD_USERS_REQUEST,
    ADD_USERS_FAIL,
    ADD_USERS_SUCCESS
} from "./actionTypes";

export const getUsers = (data, redirectPath) => {
    data={ cols:'id,username,firstname,lastname' }
    return {
        types: [GET_USERS_REQUEST,GET_USERS_FAIL,GET_USERS_SUCCESS],
        promise: (apiClient) => apiClient.get(`User/Users`, JSON.stringify(data))
    }
};

